import React, { Fragment } from 'react';
import ReactDOM from 'react-dom';

// Example of template literal

const fname = "Narmeen";
const lname = "Rameen";


ReactDOM.render(
  <>
  <h1>{`My name is ${fname} and my last name ${lname}`}</h1>
  <p>MY fav  number is {Math.random()}</p>
  <p>My lucky number is {1+2}</p>
  </>
  ,
  document.getElementById("root")

);
